class Solution4:
    def lastSubstring(self, s: str) -> str:

        i, j, k = 0, 1, 0
        n = len(s)
        while j + k < n:
            if s[i + k] == s[j + k]:
                k += 1
                continue
            elif s[i + k] > s[j + k]:
                j = j + k + 1
            else:
                i = max(i + k + 1, j)
                j = i + 1
            k = 0
        return s[i:]

class Solution:
    def lastSubstring(self, s: str) -> str:
        index = {c : i for i, c in enumerate(sorted(set(s)))}
        radix, cur, lo, val = len(index), 0, 0, 0
        for i in range(len(s) - 1, -1, -1):
            cur = index[s[i]] + cur / radix
            if cur >= val:
                lo, val = i, cur
        return s[lo:]


